import React, { Component } from 'react'
import PropTypes from 'prop-types'
import bio from './bio'
import fullName from './fullName'
import profession from './profession'

export default class Profile extends Component {
    static propTypes = {
        prop: PropTypes
    }

    render() {
        return (
            <div>
                <bio />
                <fullName />
                <profession />
            </div>
        )
    }
}
